import styled from 'styled-components';

type Props ={
    customstyle: string 
}

export const DeafaultSection = styled.div<Props>`
    max-height: 90vh;
    ${props => (props.customstyle !== '' ? props.customstyle : '')}
    scroll-snap-align: start;
`;
export const Header = styled.h1`
    text-align: center;
`;
